function ListBoxes() {
  const [employeeList, listBoxes] = useState([]);

  const columns = [
    {
      Header: "Receiver",
      accessor: "receiver",
    },
    {
      Header: "Weight",
      accessor: "weight",
    },
    {
      Header: "Box Colour",
      accessor: "color",
